            begin: "",
            system_pre: "",
            system_post: "\n",
            user_pre: "\nHuman: ",
            user_post: "\n",
            assistant_pre: "\nAssistant: ",
            assistant_post: "\n",
            end: "\nAssistant:",
        };

        /// Defines the prompt format used by Mistral AI's language models.
        const MISTRAL_PROMPT_FORMAT: PromptFormat<'_> = PromptFormat {
            begin: "",
            system_pre: "[INST] <<SYS>>",
            system_post: "<</SYS>> [/INST]",
            user_pre: "[INST]",
            user_post: "[/INST]",
            assistant_pre: "",
